const inputData = $input.first().json.content[0].text;

const startIndex = inputData.indexOf('{');
const endIndex = inputData.lastIndexOf('}') + 1;
const jsonString = inputData.substring(startIndex, endIndex);

const jsonContent = JSON.parse(jsonString);

const messagesArray = [
  {
    type: "system_message",
    content: jsonContent.system_message
  },
  {
    type: "first_message",
    content: jsonContent.firstMessage
  },
  {
    type: "voicemail_message",
    content: jsonContent.voicemailMessage
  }
];

return [{
  json: {
    messages: messagesArray
  }
}];

